pragma solidity >=0.7.0 <0.9.0;

contract MyContract {

    Product[] public listProduct;
    mapping(address=> Order) orderList;
    mapping(address=> WalletPerson) public wallets;
    enum Status{ Waiting, Confirmation, Finished}
    enum Gender { Woman, Man}
    event AddingProduct(string _name, string _desc, uint _price);

    struct Product{
        string name;
        uint256 price;
        address owner;
        uint256 rating;
        string category;
        string photo;
        Comment comment;

    }

    struct Comment{
        string[] comments;
        address[] person;
    }

    struct Order{
        Status status;
        uint product_id;
        address seller;
        address owner;
        string email;
        OrderDetail detail;
    }

    struct OrderDetail{
        Status[] status;
        uint256[] date;
    }

    struct WalletPerson{
        string name;
        Gender gender;
        string photo;
        string email;
        Order[] order;
    }

    function addProduct(string memory _name,string memory _desc, uint256 _price, string memory _category,
                        string memory _photo) public {
        // Comment[] storage _comment = ;
        // mengalokasikan memory sementara pada variabel baru
        Comment memory _comment= Comment(new string[](0),new address[](0));
        Product memory _product = Product(_name,_price,msg.sender,0,_category,_photo,_comment);
        // menambahkan produk kedalam list
        listProduct.push(_product);
        emit AddingProduct(_name,_desc,_price);
    }

    function addComments(string memory _comment,uint _index) public {
        // menambahkan comment pada product
        listProduct[_index].comment.comments.push(_comment);
        listProduct[_index].comment.person.push(msg.sender);
    }

    function giveRating(uint _index) public {
        listProduct[_index].rating += 1;
    }

    function registerAccount(string memory _name, string memory _email) public {
        WalletPerson storage person= wallets[msg.sender];
        person.name= _name;
        person.gender = Gender.Man;
        person.photo = "";
        person.email = _email;

        // wallets[msg.sender] = WalletPerson({name: _name, gender : Gender.Man, photo : "" , email : _email , order: new Order[]()});
    }

    // function addProduct()
}
